import React from "react";
import { Box, Container, Grid, Typography } from "@mui/material";

const Header = () => {
  return (
    <nav className="navbar navbar-default">
      <div className="container">
        <div className="nav">
          <h2 class={headline}>
            <a href="#">Hotel </a>
            <a href="#">Most Beautiful Places </a>
            <a href="#">About Us </a>
          </h2>
        </div>
      </div>
    </nav>
  );
};

export default Header;

const headline = {
  fontSize: '40px',
  color: '#000',
  textDecoration: 'none'
}
